import React from 'react';
import './deals.css';
import DealsTable from './DealsTable/dealstable.js';

class Deals extends React.Component {
	constructor(props) {
		super(props);

		this.state = {
			dealsdata: [],
			isLoading: true,
		}
	}

	fetchDeals() {
		fetch('http://localhost:3000/deals', {
			method: 'get',
			headers: {'Content-Type': 'application/json'},
		})
		    .then(response => response.json())
		    .then(deals => {
		  	    this.setState({
		  	    	dealsdata: deals,
		  	    	isLoading: false,
		  	    })
		  	    console.log(deals, "HIII");
		  	    console.log(this.state.dealsData, "h?");
		  	})
	}

	componentDidMount() {
		this.fetchDeals();
	}

	render() {
		return (
			<div className="container">
				<div className="dealslist">
					<table>
						<thead>
							<tr>
								<th>Tenant</th>
								<th>Property</th>
								<th>Unit</th>
							</tr>
						</thead>
						<tbody>

							{/*
								this.dealsData.map(row => (
									<tr>
										<td>{row.tenant}</td>
										<td>{row.property}</td>
										<td>{row.unit}</td>
									</tr>
								))
							*/}  
						</tbody>
					</table>
				</div>
			</div>

		);
	}
}

export default Deals;
